Is there a drop-off in home sales during a presidential election year?

BTIG noted that in non-presidential years, there is a -9.8% decrease in November compared to October. This is the normal seasonality of the market, with a slowdown in activity that‚Äôs usually seen in fall and winter. However, they also revealed that in presidential election years, the typical drop increases to -15%. Their report explains, ‚ÄúThis may indicate that potential homebuyers may become more cautious in the face of national election uncertainty.‚Äù

Are those sales lost forever?

No. BTIG determined, ‚ÄúThis caution is temporary, and ultimately results in deferred sales, as the economy, jobs, interest rates and consumer confidence all have far more meaningful roles in the home purchase decision than a Presidential election result in the months that follow.‚Äù

Will it matter who is elected?

To some degree, but not in the overall number of home sales. As BTIG said, ‚ÄúA change in administration might benefit trailing blue county housing dynamics. The re-election of President Trump could continue to propel red county outperformance.‚Äù

If mortgage rates remain near all-time lows, the economy continues to recover, and unemployment continues to decrease, the real estate market should remain strong up to and past the election.

